import React from 'react';
import logo from './logo.svg';
import './App.css';
import Home from './Components/Home';
import { Router } from '@reach/router';



function App() {
  return (
    <div className="App">
      <Router>
      <Home path='/'/>
      </Router>
    </div>
  );
}

export default App;
